  true,\n\t\"url\": null,\n\t\"notes\": \"The GPM Ground Validation Advanced Microwave
  Precipitation Radiometer (AMPR) IPHEx dataset was acquired by the AMPR instrument
  during the IPHEx field campaign in North Carolina from May 1, 2014 through June
  14, 2014. These files included the Level 2B calibrated and georeferenced brightness
  temperature for the four AMPR-observed  frequencies (10, 19, 37, 85 GHz). These
  data are archived in a netCDF-4 format that contains the calibrated brightness temperatures
  in addition to ER-2 aircraft navigation and instrument scene georectification variables.
  \ A set of Python software has been developed for reading, plotting, and providing
  some additional analysis capabilities. The AMPR instrument is managed by NASA Marshall
  Space Flight Center.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
